const Pagination = ({postPerPage,totalPost}) => {
    const pageNumber = [];
    for(let i=1; i<=Math.ceil(totalPost/postPerPage);i++){
        pageNumber.push(i);

    }
    return (
        <ul>
            {
               pageNumber.map(number=>(
                <li key ={number}>
                    <a href="#">
                        {number}
                    </a>
                </li>

               ))
            }
        </ul>
      );
}

export default Pagination;
